import React from 'react'
import {Banner} from '../components/Banner';
import {Skills} from './Skills';
import {Projects} from '../../Projects';

const Home = () => {
  return (
    <>
       <Banner />
       <Skills />
      <Projects />
    </>
  )
}

export default Home
